import React, { Component } from "react";

// import axios from 'axios'
import axios from "axios";

function getApiData() {
  let x = "789";
  // Make a request for a user with a given ID
  let obj = {
    adminId: "ADMIN123",
    email: "defg@gmail.com",
    password: "123",
    name: "qwerty",
    address: "besant nagar",
    phone: "98761234",
    sex: "female",
    guardianName: "arr",
    age: "19",
    height: "160",
    weight: "45",
    doctorId: "R3PKNRH9UZ",
  };
  // obj = JSON.stringify(obj);
  console.log("onj =", obj);
  axios
    .post(
      "http://dceed99d2fec.ngrok.io/covid19_patient_monitor/add_patient",
      obj
    )
    .then(function (response) {
      // handle success
      console.log(response.data);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    });
}

